require("typeface-roboto")
const Paper = require("react-native-paper")
const React = require("react")



exports.wrapRootElement = ({ element }) => {
    return (
        <React.Fragment>

      <Paper.Provider >
        {element}
      </Paper.Provider>
        </React.Fragment>
    )
  }
